  false,\n\t\"url\": null,\n\t\"notes\": \"This data represents the tile index for
  lidar data collected for the U.S. Geological Survey in November 2012 following Hurricane
  Sandy, which made landfall in the eastern United States on October 29th, 2012. The
  lidar LAS and derived-digital elevation model (DEM) data are divided into these
  tiles and filenames match the tile number. The index shows the extent of data collection
  (portions of the coastline of New York, Delaware, Maryland, Virginia, and North
  Carolina) and provides tile names to aid in identifying files for data download.\",\n\t\"license_title\":
